// src/components/ArtCard.js
import { Link } from 'react-router-dom';

export default function ArtCard({ art }) {
  return (
    <div>
      <img src={art.image} alt={art.title} width="200" />
      <h3>{art.title}</h3>
      <p>By User: {art.userId}</p>
      <Link to={`/art/${art._id}`}>View</Link>
    </div>
  );
}
